import React from 'react';
import './Topbar.scss'

const TopBar = () => {
	return (
		<div className="topBar">
			<div className="topBar-city">杭州</div>
			<div className="topBar-search"></div>
			<div className="topBar-scan"></div>
		</div>
	)
}

export default TopBar;
